{u'review': u'アプリのリンクはどこに消えたんでしょう？
これまでメールにカレンダーにと一つのアプリで便利に使ってきたのに。
これではまるでただのブラウザ。', u'id': u'284815942', u'name': {u'label': u'Google'}}

{u'review': u'事前登録から期待していたのに、クオリティ低すぎですね
